import React from 'react';

function SearchForm({ onSelectSport, onSelectRegion }) {
  const sports = ['야구', '농구', '풋살'];
  const regions = ['서울', '경기', '부산', '대구', '인천'];



  return (
    <div>
      <h2>체육 시설 검색</h2>

      <label>
        종목 선택:
        <select onChange={handleSportChange}>
          <option value="">선택하세요</option>
          {sports.map((sport, index) => (
            <option value={sport} key={index}>
              {sport}
            </option>
          ))}
        </select>
      </label>

      <label>
        지역 선택:
        <select onChange={handleRegionChange}>
          <option value="">선택하세요</option>
          {regions.map((region, index) => (
            <option value={region} key={index}>
              {region}
            </option>
          ))}
        </select>
      </label>
    </div>
  );
}

export default SearchForm;
